INSERT INTO `core_nx3_activity` (`activity_id`, `activity_name`, `activity_code`, `activity_description`, `activity_sql`, `enabled_yn`, `attribute1`, `attribute2`, `attribute3`, `attribute4`, `attribute5`, `attribute6`, `attribute7`, `attribute8`, `attribute9`, `attribute10`, `created_date`, `created_by`, `updated_date`, `updated_by`) VALUES
(1, 'Latest Blogs', 'BLOGS', 'Displays the latest blogs', 'select b.created_date AS activity_datetime, \r\nb.created_by AS user_id , u.display_name AS user_display_name, CONCAT(''blogged about '', b.article_name) AS \r\nactivity_message , ''BLOGS'' AS activity_module , CONCAT((SELECT value FROM @TABLE_PREFIX@nx3_setting WHERE \r\nfield = ''nx3.global.siteurl''), ''article/viewarticle/'', b.article_code, ''/'') AS activity_link, substr(b.article_text, 1, 200) AS activity_summary , ''images/icon_blog.png'' AS activity_icon FROM \r\n@TABLE_PREFIX@nx3_article b JOIN @TABLE_PREFIX@nx3_user u ON u.user_id = b.created_by WHERE b.article_folder_id IN \r\n(SELECT f.article_folder_id FROM @TABLE_PREFIX@nx3_article_folder f WHERE f.article_folder_code = ''BLOGS'') \r\nAND b.article_folder_id IN @ARTICLE_FOLDER_SECURITY@', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(2, 'Latest Yells', 'YELLS', 'Shows the latest yells from the yell box.', 'select y.created_date AS activity_datetime, \r\n\r\ny.created_by AS user_id, CASE WHEN y.created_by = -1 THEN y.name ELSE u.display_name END AS user_display_name, \r\n\r\n''yelled'' AS activity_message, ''YELL'' AS activity_module, CONCAT((SELECT value FROM \r\n\r\n@TABLE_PREFIX@nx3_setting WHERE field = ''nx3.global.siteurl''), ''yell/'') AS activity_link, comment AS \r\n\r\nactivity_summary, ''images/icon_yell.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_yell y JOIN @TABLE_PREFIX@nx3_user u \r\n\r\nON u.user_id = y.created_by', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(3, 'Twitter Feed', 'TWITTER', 'Grab cached entries from twitter.', 'select fc.pubDate AS activity_datetime,  3 AS user_id, LEFT(fc.title, INSTR(fc.title, '': '') - 1) AS user_display_name,  ''posted on twitter'' AS activity_message, ''FEED EXTERNAL'' AS activity_module, fc.link AS activity_link, SUBSTR(fc.title, INSTR(fc.title, '': '') + 2) AS activity_summary, ''images/icon_feed.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_feed_external_cache fc JOIN @TABLE_PREFIX@nx3_feed_external f ON fc.feed_external_id = f.feed_external_id WHERE f.enabled_yn = ''Y'' AND f.feed_external_code = ''TWITTER'' AND f.feed_external_id IN @FEED_EXTERNAL_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(4, 'Josh''s Blog Feed', 'JOSH', 'Grab cached entries from Josh posting on Boyter''s site.', 'select fc.pubDate AS activity_datetime, 13 AS user_id, ''josh'' AS user_display_name,  CONCAT(''blogged about '', fc.title) AS activity_message, ''FEED EXTERNAL'' AS activity_module, fc.link AS activity_link, fc.description AS activity_summary, ''images/icon_feed.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_feed_external_cache fc JOIN @TABLE_PREFIX@nx3_feed_external f ON fc.feed_external_id = f.feed_external_id WHERE f.enabled_yn = ''Y'' AND f.feed_external_code = ''JOSH'' AND f.feed_external_id IN @FEED_EXTERNAL_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(5, 'Latest Article Comments', 'ARTICLE_COMMENTS', 'Display the latest comments users have been making about articles.', 'select ac.created_date AS activity_datetime,  ac.created_by AS user_id, CASE WHEN ac.created_by = -1 THEN ac.attribute1 ELSE u.display_name END AS user_display_name,  CONCAT(''made a comment about '', a.article_name) AS  activity_message , ''ARTICLE COMMENTS'' AS activity_module , CONCAT((SELECT value FROM @TABLE_PREFIX@nx3_setting WHERE  field = ''nx3.global.siteurl''), ''article/viewarticle/'', a.article_code, ''/#article_comment_'', ac.article_comment_id) AS activity_link, substr(ac.comment_text, 1, 200) AS activity_summary , ''images/icon_comment.png'' AS activity_icon FROM  @TABLE_PREFIX@nx3_article_comment ac  JOIN @TABLE_PREFIX@nx3_article a ON ac.article_id = a.article_id JOIN @TABLE_PREFIX@nx3_user u ON u.user_id = ac.created_by WHERE a.article_folder_id IN @ARTICLE_FOLDER_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(6, 'Boyter''s Blog Feed', 'BOYTER', 'Grab cached entries from Boyter''s site.', 'select fc.pubDate AS activity_datetime, 6 AS user_id, ''boyter'' AS user_display_name,  CONCAT(''blogged about '', fc.title) AS activity_message, ''FEED EXTERNAL'' AS activity_module, fc.link AS activity_link, fc.description AS activity_summary, ''images/icon_feed.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_feed_external_cache fc JOIN @TABLE_PREFIX@nx3_feed_external f ON fc.feed_external_id = f.feed_external_id WHERE f.enabled_yn = ''Y'' AND f.feed_external_code = ''BOYTER'' AND f.feed_external_id IN @FEED_EXTERNAL_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(7, 'Boyter''s Twitter Feed', 'TWITTER_BOYTER', 'Grab cached entries from twitter.com/boyter.', 'select fc.pubDate AS activity_datetime,  6 AS user_id, LEFT(fc.title, INSTR(fc.title, '': '') - 1) AS user_display_name,  ''posted on twitter'' AS activity_message, ''FEED EXTERNAL'' AS activity_module, fc.link AS activity_link, SUBSTR(fc.title, INSTR(fc.title, '': '') + 2) AS activity_summary, ''images/icon_feed.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_feed_external_cache fc JOIN @TABLE_PREFIX@nx3_feed_external f ON fc.feed_external_id = f.feed_external_id WHERE f.enabled_yn = ''Y'' AND f.feed_external_code = ''TWITTER_BOYTER'' AND f.feed_external_id IN @FEED_EXTERNAL_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(8, 'Nato''s Twitter Feed', 'TWITTER_NATO', 'Grab cached entries from twitter.com/nconyngham.', 'select fc.pubDate AS activity_datetime,  25 AS user_id, LEFT(fc.title, INSTR(fc.title, '': '') - 1) AS user_display_name,  ''posted on twitter'' AS activity_message, ''FEED EXTERNAL'' AS activity_module, fc.link AS activity_link, SUBSTR(fc.title, INSTR(fc.title, '': '') + 2) AS activity_summary, ''images/icon_feed.png'' AS activity_icon FROM @TABLE_PREFIX@nx3_feed_external_cache fc JOIN @TABLE_PREFIX@nx3_feed_external f ON fc.feed_external_id = f.feed_external_id WHERE f.enabled_yn = ''Y'' AND f.feed_external_code = ''TWITTER_NATO'' AND f.feed_external_id IN @FEED_EXTERNAL_SECURITY@', 'N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1);
