INSERT INTO `core_nx3_feed` (`feed_id`, `feed_code`, `feed_name`, `feed_description`, `feed_sql`, `enabled_yn`, `attribute1`, `attribute2`, `attribute3`, `attribute4`, `attribute5`, `attribute6`, `attribute7`, `attribute8`, `attribute9`, `attribute10`, `created_date`, `created_by`, `updated_date`, `updated_by`) VALUES
(1, 'BLOG', 'Blog Feed', 'A sample feed to get the latest 5 blogs.', 'SELECT CONCAT((SELECT value FROM @TABLE_PREFIX@nx3_setting WHERE field = ''SITE_URL''), ''index.php/article/viewarticle/'', a.article_code) AS guid, a.article_name AS title, CONCAT((SELECT value FROM @TABLE_PREFIX@nx3_setting WHERE field = ''nx3.global.siteurl''), ''article/viewarticle/'', a.article_code) AS link, replace(substr(a.article_text, 1, 200), ''&'', ''&amp;'') AS description, a.created_date AS pubDate       FROM @TABLE_PREFIX@nx3_article a        JOIN @TABLE_PREFIX@nx3_article_folder af ON a.article_folder_id = af.article_folder_id       WHERE af.article_folder_code = ''BLOGS''       AND a.deleted_yn = ''N'' ORDER BY a.created_date DESC LIMIT 5', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1),
(4, 'YELL', 'Yell Feed', 'A sample feed to get the latest 32 yells.', 'SELECT concat((select value from @TABLE_PREFIX@nx3_setting WHERE field = ''nx3.global.siteurl''), y.yell_id) AS guid, CASE WHEN y.created_by = -1 THEN y.name ELSE u.display_name END AS title, concat((select value from @TABLE_PREFIX@nx3_setting WHERE field = ''nx3.global.siteurl''), ''yell/'') AS link, replace(y.comment, ''&'', ''&amp;'') AS description, y.created_date AS pubDate       FROM @TABLE_PREFIX@nx3_yell y JOIN @TABLE_PREFIX@nx3_user u ON y.created_by = u.user_id ORDER BY y.created_date DESC LIMIT 32', 'Y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1900-01-01 00:00:00', -1, '1900-01-01 00:00:00', -1);
